const intialState = {
    name: "안수환",
    age: 25,
    password: "zz",
};



// 액션 만들기
const changeNickname = (data) => {
    return {
        type: "CHANGE_NICKNAME",
        data,
    };
};

changeNickname('')

// (이전상태, 액션) => 다음상태
const rootRedicer = (state = intialState, action) => {
    switch (action.type) {
        case "CHANGE_NICKNAME":
            return {
                ...state,
                name: action.data,
            };
    }
};

export default rootRedicer;
